/**
 * Look up move data by name
 * Handles case-insensitive matching
 */
export function getMoveData(moveName: string): MoveData | undefined {
    // Try exact match first
    if (MOVES[moveName]) return MOVES[moveName];

    // Try case-insensitive match
    const lowerName = moveName.toLowerCase();
    for (const [name, data] of Object.entries(MOVES)) {
        if (name.toLowerCase() === lowerName) return data;
    }

    return undefined;
}
